define('/templates/privacyPolicy.js',{
name: "privacyPolicy",
data: {
compiler: [ 5, ">= 2.0.0" ],
main: function() {
return '<h2>Imprint</h2> <p> 6 Wunderkinder GmbH<br> Karl-Liebknecht-Strae 32<br> 10178 Berlin </p> <h3>Contact</h3> <p>Mail: hello@6wunderkinder.com</p> <h3>Handelsregister</h3> <p> AG Charlottenburg HRB 128663 B<br> UstID DE815214657 </p> <h3>Geschftsfhrer</h3> <p>Christian Reber</p> <h2>Privacy Policy</h2> <p>We, 6Wunderkinder GmbH (hereinafter "6Wunderkinder"), regard the protection and the confidentiality of your data as very important. We collect and use your personal data in accordance with the relevant provisions of German data protection legislation. In this Privacy Policy, we would like to tell you which personal data we collect and what we use it for.</p> <p>Below, 6Wunderkinder tells you about the type and extent of and the purposes for which personal data are collected and used. You can call up this information on our website anytime.</p> <h3>Controller</h3> <p>The controller within the meaning of German data protection laws is:</p> <p>6 Wunderkinder GmbH<br>Karl-Liebknecht-Strae 32<br>10178 Berlin<br></p> <p>If you have any questions or concerns about data protection, you are welcome to also contact us by email at this address: <a href="mailto:support@wunderlist.com" data-track="Mailto:Support Contact:Privacy Policy">support@wunderlist.com</a></p> <h3>Subject of Data Protection</h3> <p>The subject of data protection is personal data. According to Section 3, Subsection 1 of the German Federal Data Protection Act ("Bundesdatenschutzgesetz"), these are individual details on personal or objective circumstances of a certain person or certain persons. These include details such as your name, your postal address, your email address, your telephone number or, where appropriate, even use-data.</p> <h3>Collection and Use of Data</h3> <h4>Automated Data Collection</h4> <p>When you access 6Wunderkinder websites, your internet browser automatically transmits data for technical reasons. The following data are stored separately from other data that you may have sent us:</p> <ul> <li>your date and time of access,</li> <li>your browser-type and version,</li> <li>the operating system you use,</li> <li>the URL of the website you have previously visited,</li> <li>the quantity of data transmitted.</li> </ul> <p>For technical reasons these data are stored and are not assigned to any identifiable person at any time.</p> <h4>Data Entered by Users</h4> <p>You can use the Wunderlist product both with and without registering. However, you can only access Wunderlist using certain terminals such as an iPhone, iPod, iPad, Windows, Mac or Android and without additional functions. In order to make use of all its advantages, you have to register. To do this, you must enter your email address and select a password. We require these data in order to guarantee that you are able to make full use of our entire offer. We need these and possibly other data not least in order to respond to your wishes, questions and criticism.</p> <p>In future, we plan to introduce an option which will allow you to design your account personally. For example, you will be able to add a photo, choose a username and set up a connection to your Facebook user account. You will not be obliged to design your account personally; this will be entirely voluntary.</p> <p>The central function of Wunderlist product is task management. You will be able to use this product both online and offline.</p> <p>Where Wunderlist is used solely offline, the data you enter will be stored de-centrally on your storage medium. In such a case, we will not be able to access these data.</p> <p>If you use Wunderlist in combination with a registered account, all data and tasks entered will be integrated into a database. The purpose of this database is to allow you to use Wunderlist at various different levels and call up your tasks anywhere and at any time. Data are transmitted to the respective terminal using SSL encryption so that your data are transmitted securely.</p> <p>We use personal data in order to enable secure, effective and user-related use of Wunderlist services, including for:</p> <ul> <li>calling up the task-list via the internet;</li> <li>anonymously analysing task management statistics for press releases by 6Wunderkinder and studies;</li> <li>recommending Wunderlist by using the "Invite" function for friends and acquaintances (email address).</li> </ul> <h4>Transfer of Data</h4> <p>We will not transfer your data to third parties as a matter of course without letting you know in advance or asking for your prior permission. We may only transfer your data to third parties without informing you separately beforehand in the following exceptional cases as explained below:</p> <ul> <li>If required for investigating the illegal use of Wunderlist or for legal proceedings, personal data will be transferred to the criminal investigation authorities and, if appropriate, to injured third parties. We will only do this if there are concrete indications of illegal and/or abusive behaviour. We can only transfer on your personal data if this is used to enforce General Terms and Conditions of Business or other agreements. We are also legally obliged to give certain public authorities information. These are criminal investigation authorities, public authorities which prosecute administrative offences entailing fines and the German finance authorities.</li> <li>Occasionally we depend on contractually affiliated external companies and external service providers to supply services such as the supply of advertising measures (only if you have given your explicit prior consent), processing payments (PayPal, credit card etc.), storing your data and customer service. In such cases, information is transferred to these companies or individuals in order to enable them to process this information further. We carefully select these external service providers and review them regularly to ensure that your privacy is preserved. The service providers may only use the data for the purposes stipulated by us. We also contractually require the service providers to treat your data solely in accordance with this Privacy Policy and the German data protection laws.</li> <li>In order to further develop our business, we may alter the corporate structure of 6Wunderkinder GmbH by changing its legal form. We may also form, sell or buy subsidiaries, divisions or parts of the company. In such transactions, customer information together with the part of the company to be transferred will be passed on. Every time personal data are transferred to third parties to the extent prescribed, 6Wunderkinder will ensure that this is done in accordance with this Privacy Policy and the relevant data protection laws.</li> </ul> <h4>Newsletter</h4> <p>6Wunderkinder provides a newsletter service free of charge. We use the newsletter to inform you about new products and send you general information about 6Wunderkinder. We need your email address in order to send you the newsletter. You can enter your email address on 6Wunderkinder\'s start page, which is available at <a href="http://www.6wunderkinder.com">http://www.6wunderkinder.com</a>. We will store and use your email address solely to send you the newsletter.</p> <p>Of course you can unsubscribe the newsletter at any time. Every newsletter contains the information on how you can unsubscribe the newsletter with effect for the future.</p> <h4>Cookies</h4> <p>6Wunderkinder stores so-called "cookies" in order to be able to offer you a comprehensive range of functions and to make it easier to use our websites. "Cookies" are small files which are stored on your computer with the help of the internet browser. If you do not want to use "cookies", you can prevent "cookies" from being stored on your computer using the corresponding settings on your internet browser. Please note that this may restrict the functional capability and the range of functions of our offer.</p> <h3>Analysis of Wunderlist</h3> <h4>Statistical Data</h4> <p>When Wunderlist is used, we collect statistical data which can be traced to you. We use it to improve Wunderlist.</p> <h4>Google Analytics</h4> <p>6Wunderkinder uses Google Analytics, a web analysis service of Google Inc. ("Google"). Google Analytics uses so-called "cookies", text files which are stored on your computer and which enable you to analyse your use of Wunderlist. The information generated by the cookie on your use of Wunderlist (including your abbreviated IP address) is transmitted to a Google server in the USA and are stored there. Google will use this information to assess your use of Wunderlist, to compile reports on the activities for us and to provide more services connected with use of Wunderlist and the internet. It is also possible that Google may transmit this information to third parties if this is prescribed by law or if third parties process this information on behalf of Google.</p> <p><strong>You can deactivate Google Analytics by means of a browser add-on if you do not want Wunderlist analysis. You can download this here: <a href="http://tools.google.com/dlpage/gaoptout?hl=de"> http://tools.google.com/dlpage/gaoptout?hl=de.</a></strong></p> <h4>Deleting Your Data</h4> <p>If your data are no longer required for the aforementioned purposes, we will delete them. Completed tasks will remain stored and will be marked "Completed" in the database. If you delete your account, we will also delete all data completely from your account (lists, tasks and shared lists). Data you have entered in lists belonging to third parties will remain in existence as these are part of third party accounts. If data has to be retained for statutory reasons, these will be blocked and will then no longer be available for any further use.</p> <h4>Right to Information and Correction</h4> <p>You naturally have the right to receive information about the data held and stored by 6Wunderkinder about you. Equally, you have the right to have incorrect data corrected or blocked. To have this done, please contact: <a href="mailto:support@wunderlist.com" data-track="Mailto:Support Contact:Privacy Policy">support@wunderlist.com</a> or by post to the address given above.</p> <h4>Amendments to this Privacy Policy</h4> <p>We reserve the right to amend this Privacy Policy. You can call up the current version of the Privacy Policy at any time at: <a href="http://www.6wunderkinder.com/privacy-policy">www.6wunderkinder.com/privacy-policy</a>.</p>';
},
useData: !0
}
});
